import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import Container from 'react-bootstrap/Container'
import './Content1.css'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'


const Content1 = () => {
    return (
        <div>
            <Jumbotron className="Jumbo1" fluid>
                <Container>
                   <Row>
                       <Col><h1 className="left ch1">WELCOME TO THE PREDICTION SYSTEM...</h1></Col>
                       <Col><h4 className="ch2">This is a military module which works over the pattern modelling and a sequential prediction.Where officials are going to predict the success rate of terrorist attack with the help of certain dependent factors that are going uphold the percentage occurence of terrorist Act.</h4></Col>
                   </Row>

                </Container>
            </Jumbotron>
        </div>
    );

}

export default Content1;
